import React from 'react'
import { Typography,Box,Stack } from '@mui/material'

const ExerciseVideos = ({exerciseVideos,name}) => {
  return (
    <Box sx={{display:'flex',mt:{lg:'70px',xs:'50px'},alignItems:'center', justifyContent:'center'}} p='20px'>
      <Typography variant='h4' mb='33px'>
        Watch <span style={{color:'#ff2625',textTransform:'capitalize'}}>{name}</span> Exercise Videos
      </Typography>

      <Stack flexWrap={'wrap'} alignItems={'center'} justifyContent={'flex-start'}
        SX={{
          flexDirection:{lg:'row'},gap:{lg:'110px',xs:'20px'},
          flexWrap:{lg:'wrap',xs:'nowrap'}, px:{lg:'20px',
            xs:'0px'},borderRadius:'4px'
        }}
      >
        {exerciseVideos?.slice(0,3).map((item,index)=>(
          <a key={index} className='exercise-video' href={`https://www.youtube.com/`}/>
        ))}
      </Stack>
    </Box>
  )
}

export default ExerciseVideos
